window.onload=function(){document.querySelectorAll(".github-card").forEach((t=>{const e=t.getAttribute("data-github"),i=t.getAttribute("data-width"),r=t.getAttribute("data-height"),h=t.getAttribute("data-theme"),u=document.createElement("iframe");u.setAttribute("src",`mine/gh_pro.html?user=${e}&width=${i}&height=${r}&theme=${h}`),u.setAttribute("width",i),u.setAttribute("height",r),u.setAttribute("frameborder","0"),u.setAttribute("scrolling","no"),t.appendChild(u)}))};